import { Link } from "react-router-dom";
import { items, ItemsNavbar } from "./items";
import "./styles.css";
export const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="nav-ul">
        <li className="nav-items">
          <Link to="/" className="nav-links">
            Navbar
          </Link>
        </li>
        {items.map((value: ItemsNavbar) => (
          <li className="nav-items" key={value.id}>
            <Link to={value.route} className="nav-links">
              {value.label}
            </Link>
          </li>
        ))}
      </ul>
      <ul className="nav-ul">
        <li className="nav-items-left">
          <a className="nav-links">Sign out</a>
        </li>
      </ul>
    </nav>
  );
};
